import React from 'react'

export default function HealthMeasurements() {
    return (
        <div>
              <div >
                <TextField
                    id="HeartRate"
                    label="Heart Rate (BPM)"
                    type="number"
                    InputProps={{ className: classes.input }}
                    InputLabelProps={{
                        className: classes.label
                    }}
                />

                <TextField
                    id="standard-number"
                    label="Max Temperature (F)"
                    type="number"
                    InputProps={{ className: classes.input }}
                    InputLabelProps={{
                        className: classes.label
                    }}
                />
                <TextField
                    id="standard-number"
                    label="Pulse Oxygen (%sp02)"
                    type="number"
                    InputProps={{ className: classes.input }}
                    InputLabelProps={{
                        className: classes.label
                    }}
                />
            </div> 
        </div>
    )
}
